          <div className=" ">
              <h3 className="text-lg  px-10 pb-3 lg:p-10">ইনবক্স বার্তা</h3>
              
              <div className="flex flex-row p-5 gap-5 border-b border-gray-400 items-center md:justify-center lg:justify-end relative">
          <button className="bg-common-blue w-full lg:w-auto hover:bg-blue-900 rounded-sm text-white text-sm px-10 py-1">ইনবক্স</button>
          

          <button className="bg-gray-200 w-full lg:w-auto rounded-sm hover:bg-gray-400 px-10 text-sm py-1">বিজ্ঞপ্তি</button>
         
        </div>
           
          </div>
        </div>
      </div>
    );
};

